t. Same as Wood\n   cut, under Wood.'),('Woodcutter','n.','A person who cuts wood.'),('Woodcutter','n.','An engraver on wood.'),('Woodcutting','n.','The act or employment of cutting wood or timber.'),('Woodcutting','n.','The act or art of engraving on wood.'),('Wooded','a.','Supplied or covered with wood, or trees; as, land wooded\n   and watered.'),('Wooden','a.','Made or consisting of wood; pertaining to, or resembling,\n   wood; as, a wooden box; a wooden leg; a wooden wedding.'),('Wooden','a.','Clumsy; awkward; ungainly; stiff; spiritless.'),('Woodenly','adv.','Clumsily; stupidly; blockishly.'),('Woodenness','n.','Quality of being wooden; clumsiness; stupidity;\n   blockishness.'),('Woodhack','n.','Alt. of Woodhacker'),('Woodhacker','n.','The yaffle.'),('Woodnewer','n.','A woodpecker.'),('Woodhole','n.','A place where wood is stored.'),('Woodhouse','n.','A house or shed in which wood is stored, and sheltered\n   from the weather.'),('Woodiness','n.','The quality or state of being woody.'),('Woodknacker','n.','The yaffle.'),('Woodland','n.','Land covered with wood or trees; forest; land on which\n   trees are suffered to grow, either for fuel or timber.'),('Woodland','a.','Of or pertaining to woods or woodland; living in the\n   forest; sylvan.'),('Woodlander','n.','A dweller in a woodland.'),('Wood-layer','n.','A young oak, or other timber plant, laid down in a\n   hedge among the whitethorn or other plants used in hedges.'),('Woodless','a.','Having no wood; destitute of wood.'),('Woodly','adv.','In a wood, mad, or raving manner; madly; furiously.'),('Woodmen','pl. ','of Woodman'),('Woodman','n.','A forest officer appointed to take care of the king\'s\n   woods; a forester.'),('Woodman','n.','A sportsman; a hunter.'),('Woodman','n.','One who cuts down trees; a woodcutter.'),('Woodman','n.','One who dwells in the woods or forest; a bushman.'),('Woodmeil','n.','See Wadmol.'),('Woodmonger','n.','A wood seller.'),('Woodness','n.','Anger; madness; insanity; rage.'),(