 of the\n   force into the amount of motion along the direction of the force. See\n   Conservation of energy, under Conservation, Unit of work, under Unit,\n   also Foot pound, Horse power, Poundal, and Erg.'),('Work','n.','Ore before it is dressed.'),('Work','n.','Performance of moral duties; righteous conduct.'),('Worked','imp. & p. p.','of Work'),('Wrought','','of Work'),('Working','p. pr. & vb. n.','of Work'),('Work','n.','To exert one\'s self for a purpose; to put forth effort for\n   the attainment of an object; to labor; to be engaged in the performance\n   of a task, a duty, or the like.'),('Work','n.','Hence, in a general sense, to operate; to act; to perform;\n   as, a machine works well.'),('Work','n.','Hence, figuratively, to be effective; to have effect or\n   influence; to conduce.'),('Work','n.','To carry on business; to be engaged or employed customarily;\n   to perform the part of a laborer; to labor; to toil.'),('Work','n.','To be in a state of severe exertion, or as if in such a\n   state; to be tossed or agitated; to move heavily; to strain; to labor;\n   as, a ship works in a heavy sea.'),('Work','n.','To make one\'s way slowly and with difficulty; to move or\n   penetrate laboriously; to proceed with effort; -- with a following\n   preposition, as down, out, into, up, through, and the like; as, scheme\n   works out by degrees; to work into the earth.'),('Work','n.','To ferment, as a liquid.'),('Work','n.','To act or operate on the stomach and bowels, as a cathartic.'),('Work','v. t.','To labor or operate upon; to give exertion and effort to;\n   to prepare for use, or to utilize, by labor.'),('Work','v. t.','To produce or form by labor; to bring forth by exertion or\n   toil; to accomplish; to originate; to effect; as, to work wood or iron\n   into a form desired, or into a utensil; to work cotton or wool into\n   cloth.'),('Work','v. t.','To produce by slow degrees, or as if laboriously; to bring\n   gradually into any state by action or motion.'),('Work','v. t.','To influence by acting upon; to prevail upon; to manage;\n   to lead.'),('Work','v. t.','To form with a needle and thread or yarn; especially, to\n   embroider; as, to work muslin.'),('Work','v. t.','To set in motion or action; to direct the action of; to\n   keep at work; to govern; to manage; as, to work a machine.'),('Work','v. t.','To cause to ferment, as liquor.'),('Workable','a.','Capable of being worked, or worth working; as, a workable\n   mine; workable clay.'),('Workaday','n.','See Workyday.'),('Workbag','n.','A bag for holding implements or materials for work;\n   especially, a reticule, or bag for holding needlework, and the like.'),('Workbasket','n.','A basket for holding materials for needlework, or the\n   like.'),('Workbench','n.','A bench on which work is performed, as in a carpenter\'s\n   shop.'),('Workbox','n.','A box for holding instruments or materials for work.'),('Workday','n. & a.','A day on which work is performed, as distinguished\n   from Sunday, festivals, etc., a working day.'),('Worker','n.','One who, or that which, works; a laborer; a performer; as,\n   a worker in brass.'),('Worker','n.','One of the neuter, or sterile, individuals of the social\n   ants, bees, and white ants. The workers are generally females having\n   the sexual organs imperfectly developed. See Ant, and White ant, under\n   White.'),('Workfellow','n.','One engaged in the same work with another; a companion\n   in work.'),('Workfolk','n.','People that labor.'),('Workful','a.','Full of work; diligent.'),('Workhouses','pl. ','of Workhouse'),('Workhouse','n.','A house where any manufacture is carried on; a workshop.'),('Workhouse','n.','A house in which idle and vicious persons are confined\n   to labor.'),('Workhouse','n.','A house where the town poor are maintained at public\n   expense, and provided with labor; a poorhouse.'),('Working','','a & n. from Work.'),('Working-day','a.','Pertaining to, or characteristic of, working days, or\n   workdays; everyday; hence, plodding; hard-working.'),('Workingmen','pl. ','of Workingman'),('Workingman','n.','A laboring man; a man who earns his daily support by\n   manual labor.'),('Workless','a.','Without work; not laboring; as, many people were still\n   workless.'),('Workless','a.','Not carried out in practice; not exemplified in fact; as,\n   workless faith.'),('Workmen','pl. ','of Workman'),('Workman','n.','A man employed in labor, whether in tillage or\n   manufactures; a worker.'),('Workman','n.','Hence, especially, a skillful artificer or laborer.'),('Workmanlike','a.','Becoming a workman, especially a skillful one;\n   skillful; well performed.'),('Workmanly','a.','Becoming a skillful workman; skillful; well performed;\n   workmanlike.'),('Workmanly','adv.','In a skillful manner; in a manner becoming a skillful\n   workman.'),('Workmanship','n.','The art or skill of a workman; the execution or manner\n   of making anything.'),('Workmanship','n.','That which is effected, made, or produced;\n   manufacture, something made by manual labor.'),('Workmaster','n.','The performer of any work; a master workman.'),('Workroom','n.','Any room or apartment used especially for labor.'),('Workship','n.','Workmanship.'),('Workshop','n.','A shop where any manufacture or handiwork is carried on.'),('Worktable','n.','A table for holding working materials and implements;\n   esp., a small table with drawers and other conveniences for needlework,\n   etc.'),('Workwomen','pl. ','of Workwoman'),('Workwoman','n.','A woman who performs any work; especially, a woman\n   skilled in needlework.'),('Workyday','n.','A week day or working day, as distinguished from Sunday\n   or a holiday. Also used adjectively.'),('World','n.','The earth and the surrounding heavens; the creation; the\n   system of created things; existent creation; the universe.'),('World','n.','Any planet or heavenly body, especially when considered as\n   inhabited, and as the scene of interests analogous with human\n   interests; as, a plurality of worlds.'),('World','n.','The earth and its inhabitants, with their concerns; the sum\n   of human affairs and interests.'),('World','n.','In a more restricted sense, that part of the earth and its\n   concerns which is known to any one, or contemplated by any one; a\n   division of the globe, or of its inhabitants; human affairs as seen\n   from a certain position, or from a given point of view; also, state of\n   existence; scene of life and action; as, the Old World; the New World;\n   the religious world; the Catholic world; the upper world; the future\n   world; the heathen world.'),('World','n.','The customs, practices, and interests of men; general\n   affairs of life; human society; public affairs and occupations; as, a\n   knowledge of the world.'),('World','n.','Individual experience of, or concern with, life; course of\n   life; sum of the affairs which affect the individual; as, to begin the\n   world with no property; to lose all, and begin the world anew.'),('World','n.','The inhabitants of the earth; the human race; people in\n   general; the public; mankind.'),('World','n.','The earth and its affairs as distinguished from heaven;\n   concerns of this life as distinguished from those of the life to come;\n   the present existence and its interests; hence, secular affairs;\n   engrossment or absorption in the affairs of this life; worldly\n   corruption; the ungodly or wicked part of mankind.'),('World','n.','As an emblem of immensity, a great multitude or quantity; a\n   large number.'),('Worldliness','n.','The quality of being worldly; a predominant passion\n   for obtaining the good things of this life; covetousness; addictedness\n   to gain and temporal enjoyments; worldly-mindedness.'),('Worldling','','A person whose soul is set upon gaining temporal\n   possessions; one devoted to this world and its enjoyments.'),('Worldly','a.','Relating to the world; human; common; as, worldly maxims;\n   worldly actions.'),('Worldly','a.','Pertaining to this world or life, in contradistinction\n   from the life to come; secular; temporal; devoted to this life and its\n   enjoyments; bent on gain; as, worldly pleasures, affections, honor,\n   lusts, men.'),('Worldly','a.','Lay, as opposed to clerical.'),('Worldly','adv.','With relation to this life; in a worldly manner.'),('Worldly-minded','a.','Devoted to worldly interests; mindful of the\n   affairs of the present life, and forgetful of those of the future;\n   loving and pursuing this world\'s goods, to the exclusion of piety and\n   attention to spiritual concerns.'),('World-wide','a.','Extended throughout the world; as, world-wide fame.'),('Worldlywise','a.','Wise in regard to things of this world.'),('Worm','n.','A creeping or a crawling animal of any kind or size, as a\n   serpent, caterpillar, snail, or the like.'),('Worm','n.','Any small creeping animal or reptile, either entirely without\n   feet, or with very short ones, including a great variety of animals;\n   as, an earthworm; the blindworm.'),('Worm','n.','Any helminth; an entozoon.'),('Worm','n.','Any annelid.'),('Worm','n.','An insect larva.'),('Worm','n.','Same as Vermes.'),('Worm','n.','An internal tormentor; something that gnaws or afflicts one\'s\n   mind with remorse.'),('Worm','n.','A being debased and despised.'),('Worm','n.','Anything spiral, vermiculated, or resembling a worm'),('Worm','n.','The thread of a screw.'),('Worm','n.','A spiral instrument or screw, often like a double corkscrew,\n   used for drawing balls from firearms.'),('Worm','n.','A certain muscular band in the tongue of some animals, as the\n   dog; the lytta. See Lytta.'),('Worm','n.','The condensing tube of a still, often curved and wound to\n   economize space. See Illust. of Still.'),('Worm','n.','A short revolving screw, the threads of which drive, or are\n   driven by, a worm wheel by gearing into its teeth or cogs. See Illust.\n   of Worm gearing, below.'),('Wormed','imp. & p. p.','of Worm'),('Worming','p. pr. & vb. n.','of Worm'),('Worm','v. i.','To work slowly, gradually, and secretly.'),('Worm','v. t.','To effect, remove, drive, draw, or the like, by slow and\n   secret means; -- often followed by out.'),('Worm','v. t.','To clean by means of a worm; to draw a wad or cartridge\n   from, as a firearm. See Worm, n. 5 (b).'),('Worm','n.','To cut the worm, or lytta, from under the tongue of, as a\n   dog, for the purpose of checking a disposition to gnaw. The operation\n   was formerly supposed to guard against canine madness.'),('Worm','n.','To wind rope, yarn, or other material, spirally round,\n   between the strands of, as a cable; to wind with spun yarn, as a small\n   rope.'),('Wormal','n.','See Wormil.'),('Worm-eaten','a.','Eaten, or eaten into, by a worm or by worms; as,\n   worm-eaten timber.'),('Worm-eaten','a.','Worn-out; old; worthless.'),('Wormed','a.','Penetrated by worms; injured by worms; worm-eaten; as,\n   wormed timber.'),('Wormhole','n.','A burrow made by a worm.'),('Wormian','a.','Discovered or described by Olanus Wormius, a Danish\n   anatomist.'),('Wormil','n.','Any botfly larva which burrows in or beneath the skin of\n   domestic and wild animals, thus producing sores. They belong to various\n   species of Hypoderma and allied genera. Domestic cattle are often\n   infested by a large species. See Gadfly. Called also warble, and\n   worble.'),('Wormil','n.','See 1st Warble, 1 (b).'),('Wormling','n.','A little worm.'),('Wormseed','n.','Any one of several plants, as Artemisia santonica, and\n   Chenopodium anthelminticum, whose seeds have the property of expelling\n   worms from the stomach and intestines.'),('Worm-shaped','a.','Shaped like a worm; /hick and almost cylindrical, but\n   variously curved or bent; as, a worm-shaped root.'),('Worm-shell','n.','Any species of Vermetus.'),('Wormul','n.','See Wornil.'),('Wormwood','n.','A composite plant (Artemisia Absinthium), having a bitter\n   and slightly aromatic taste, formerly used as a tonic and a vermifuge,\n   and to protect woolen garments from moths. It gives the peculiar flavor\n   to the cordial called absinthe. The volatile oil is a narcotic poison.\n   The term is often extended to other species of the same genus.'),('Wormwood','n.','Anything very bitter or grievous; bitterness.')




